// src/modules/CloudDataServerModule.js
import React, { useState, useMemo, useEffect } from "react";
import "./CloudDataServerModule.css";

/**
 * CloudDataServerModule
 *
 * - apiBase: base URL for your FastAPI backend (e.g. "http://localhost:8000")
 *   If left empty string, it will call same-origin endpoints.
 *
 * Behavior:
 * - Clicking a domain triggers GET /api/datasets/{domain}
 * - Clicking "Request access" triggers POST /api/presign { domain, dataset }
 * - On success, Request access button is replaced with Raw/Curated/Metadata download buttons
 */

const DOMAINS = [
  {
    id: "oceanography",
    label: "Oceanography",
    description: "CTD, nutrients, currents, satellite SST & Chl-a grids.",
  },
  {
    id: "biodiversity",
    label: "Biodiversity",
    description: "Species diversity, ecosystem assessments, biodiversity indices.",
  },
  {
    id: "molecular",
    label: "Molecular / eDNA",
    description: "DNA barcodes, eDNA reads, metabarcoding matrices.",
  },
  {
    id: "taxonomy",
    label: "Taxonomy & Systematics",
    description: "Species checklists, occurrence tables, reference libraries.",
  },
];

export default function CloudDataServerModule({ apiBase = "" }) {
  // active domain state
  const [activeDomain, setActiveDomain] = useState("oceanography");

  // datasets list returned by backend for activeDomain (array of base names)
  const [datasets, setDatasets] = useState([]);
  const [loadingDatasets, setLoadingDatasets] = useState(false);

  // presign results keyed by dataset name
  // { [dataset]: { raw_url, curated_url, metadata_url, missing: [], tried_keys: {...} } }
  const [presigns, setPresigns] = useState({});

  // loading states for individual presign requests
  const [loadingPresign, setLoadingPresign] = useState({});

  // error banner
  const [error, setError] = useState(null);

  const activeDomainMeta = useMemo(
    () => DOMAINS.find((d) => d.id === activeDomain),
    [activeDomain]
  );

  useEffect(() => {
    // load datasets when activeDomain changes
    listDatasets(activeDomain);
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [activeDomain]);

  async function listDatasets(domain) {
    setError(null);
    setLoadingDatasets(true);
    setDatasets([]);
    try {
      const url = `${apiBase}/api/datasets/${encodeURIComponent(domain)}`;
      const resp = await fetch(url);
      if (!resp.ok) {
        const text = await resp.text();
        throw new Error(`List failed: ${resp.status} ${text}`);
      }
      const json = await resp.json();
      // json expected to be an array of dataset base names
      setDatasets(Array.isArray(json) ? json : []);
    } catch (err) {
      console.error("listDatasets error:", err);
      setError(err.message || "Failed to list datasets");
    } finally {
      setLoadingDatasets(false);
    }
  }

  async function requestAccess(domain, dataset) {
    setError(null);
    setLoadingPresign((p) => ({ ...p, [dataset]: true }));
    try {
      const url = `${apiBase}/api/presign`;
      const resp = await fetch(url, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ domain, dataset, expires_in: 300 }),
      });
      if (!resp.ok) {
        const text = await resp.text();
        throw new Error(`Presign failed: ${resp.status} ${text}`);
      }
      const json = await resp.json();
      setPresigns((p) => ({ ...p, [dataset]: json }));
    } catch (err) {
      console.error("requestAccess error:", err);
      setError(err.message || "Failed to request access");
    } finally {
      setLoadingPresign((p) => ({ ...p, [dataset]: false }));
    }
  }

  // small helper render for access controls
  function AccessControls({ domain, dataset }) {
    const presign = presigns[dataset] || null;
    const requesting = !!loadingPresign[dataset];

    if (!presign) {
      return (
        <button
          type="button"
          className="btn cloud-btn-view"
          onClick={() => requestAccess(domain, dataset)}
          disabled={requesting}
        >
          {requesting ? "Requesting…" : "Request access"}
        </button>
      );
    }

    const { raw_url, curated_url, metadata_url, missing = [] } = presign;

    return (
      <div className="access-buttons" role="group" aria-label={`access-${dataset}`}>
        {raw_url ? (
          <a
            className="access-btn"
            href={raw_url}
            target="_blank"
            rel="noreferrer"
            download
            title="Download raw file"
          >
            Raw
          </a>
        ) : (
          <button className="access-btn disabled" aria-disabled="true" title="Raw not available">
            Raw
          </button>
        )}

        {curated_url ? (
          <a
            className="access-btn"
            href={curated_url}
            target="_blank"
            rel="noreferrer"
            download
            title="Download curated file"
          >
            Curated
          </a>
        ) : (
          <button className="access-btn disabled" aria-disabled="true" title="Curated not available">
            Curated
          </button>
        )}

        {metadata_url ? (
          <a
            className="access-btn"
            href={metadata_url}
            target="_blank"
            rel="noreferrer"
            download
            title="Download metadata"
          >
            Metadata
          </a>
        ) : (
          <button className="access-btn disabled" aria-disabled="true" title="Metadata not available">
            Metadata
          </button>
        )}
      </div>
    );
  }

  return (
    <div className="cloud-layout">
      {/* Domains grid */}
      <section className="cloud-domain-grid" role="tablist" aria-label="domains">
        {DOMAINS.map((dom) => (
          <button
            key={dom.id}
            type="button"
            className={dom.id === activeDomain ? "cloud-domain-card cloud-domain-card-active" : "cloud-domain-card"}
            onClick={() => setActiveDomain(dom.id)}
            aria-pressed={dom.id === activeDomain}
          >
            <div className="cloud-domain-label">{dom.label}</div>
            <p className="cloud-domain-desc">{dom.description}</p>
          </button>
        ))}
      </section>

      {/* Datasets panel */}
      <section className="cloud-datasets-panel" aria-live="polite">
        <header className="cloud-datasets-header">
          <div>
            <h3 className="cloud-datasets-title">{activeDomainMeta?.label || "Selected domain"}</h3>
            <p className="cloud-datasets-subtitle">
              {loadingDatasets ? "Loading datasets…" : `${datasets.length} dataset${datasets.length !== 1 ? "s" : ""} registered`}
            </p>
          </div>

          <div className="cloud-datasets-meta">
            <span className="cloud-chip">
              Node group:{" "}
              {activeDomain === "oceanography"
                ? "OCN-*"
                : activeDomain === "biodiversity"
                ? "BIO-*"
                : activeDomain === "molecular"
                ? "MOL-*"
                : "TAX-*"}
            </span>
          </div>
        </header>

        <div className="cloud-dataset-list">
          {error && (
            <div style={{ color: "salmon", padding: 8, fontWeight: 600 }}>
              {error}
            </div>
          )}

          {datasets.length === 0 && !loadingDatasets && (
            <div className="cloud-empty-state">
              <p className="cloud-empty-title">No datasets registered</p>
              <p className="cloud-empty-text">
                This domain does not have any datasets yet in the Cloud Data Server.
                Once ingestion pipelines are configured, they will appear here.
              </p>
            </div>
          )}

          {datasets.map((name) => (
            <article key={name} className="cloud-dataset-card" aria-label={`dataset-${name}`}>
              <div className="cloud-dataset-main">
                <h4 className="cloud-dataset-name">{name}</h4>
                <p className="cloud-dataset-type">Dataset</p>

                <div className="cloud-dataset-tags">
                  <span className="cloud-pill cloud-pill-domain">{activeDomainMeta?.label}</span>
                  <span className="cloud-pill status-online">Status: Online</span>
                </div>
              </div>

              <div className="cloud-dataset-meta">
                <p className="cloud-meta-line"><span className="cloud-meta-label">Access:</span> Controlled</p>
                <p className="cloud-meta-line"><span className="cloud-meta-label">Updated:</span> —</p>

                {/* Access controls (Request access -> presign -> download buttons) */}
                <AccessControls domain={activeDomain} dataset={name} />

                <button
                  type="button"
                  className="btn cloud-btn-view"
                  style={{ marginTop: 8 }}
                  onClick={() => alert(`Open dataset detail for ${name}`)}
                >
                  View dataset
                </button>
              </div>
            </article>
          ))}
        </div>
      </section>
    </div>
  );
}
